import React from 'react';

const Auth = () => {
    return (
        <div className='d-flex justify-content-center align-items-center' style={{height: window.innerHeight - 54}}>
            <div class="card">
                <h1></h1>
                <div class="card-body">
                    This is some text within a card body.
                </div>
            </div>
        </div>
    );
};

export default Auth;
